import React from 'react';

/**
 * Logo component using an embedded Data URI.
 * This is the most reliable way to ensure your exact logo is used.
 */
export function Logo({ className = "h-12 w-auto" }: { className?: string }) {
  /**
   * REPLACEMENT INSTRUCTIONS:
   * 1. Convert your logo file (PNG, SVG, or JPG) to a Base64 string.
   * 2. Replace the string below with your new string.
   * 3. It must start with "data:image/..."
   */
  const LOGO_DATA = "data:image/data:image/png;base64,";

  return (
    <img 
      src={LOGO_DATA} 
      alt="Love Our Island Logo" 
      className={`block object-contain select-none pointer-events-none ${className}`}
      draggable={false}
    />
  );
}
